import message from './Dialogs.module.css';
import DialogItem from './DialogItem/DialogsItem';
import Message from "./MessagesItem/Message";

let dialogsData = [
    {id: 1, name: "Dimych",},
    {id: 2, name: "Evgeniy",},
    {id: 3, name: "Sasha",},
]




let messagesData = [
    {id: 1, message: "Hello",},
    {id: 2, message: "How are you?",},
    {id: 3, message: "Chel",},
]



function Dialogs() {

    let dialogsElements = dialogsData.map( d => <DialogItem name={d.name} id={d.id}/>)
    let messagesElements = messagesData.map( m => <Message content={m.message} id={m.id}/>)
    return(
        <div className={message.dialogs}>
            <div className={message.notify}>
                {dialogsElements}
            </div>
            <div className={message.paper_dial}>
                {messagesElements}
            </div>
        </div>
    );
}

export default Dialogs
